import { HomeRounded, InfoRounded, BookRounded, ShoppingCartRounded, PhoneRounded } from "@material-ui/icons";

const HeaderMenu = [{ navLink_text: "Home", navLink_icon: <HomeRounded />, navLink_path: "index.html" }, {
    navLink_text: "About", navLink_icon: <InfoRounded />, navLink_path: "#about"
}, {
    navLink_text: "Blog", navLink_icon: <BookRounded />, navLink_path: "#blog"
}, { navLink_text: "Pricing", navLink_icon: <ShoppingCartRounded />, navLink_path: "#pricing" }, { navLink_text: "Contact", navLink_icon: PhoneRounded, navLink_path: "#contact" }];

export default HeaderMenu;
